            content.DATA_TRACK_NAME = data_track_name;
            content.DATA_DIVISION = data_division;
            content.DATA_DISTRICT = data_district;
            content.DIRECTION = direction;
            content.TYPE_OF_REPORTING = type_of_reporting;
            content.TRANSMISSION_TYPE = transmission_type;
            
            DateTime reportingTime = now.AddMinutes(Convert.ToDouble(reporting_time));
            content.REPORTING_DATE = reportingTime.ToString("MMddyyyy");
            content.REPORTING_TIME = reportingTime.ToString("HHmm");
            content.REPORTING_TIME_ZONE = reporting_time_zone;
