        public string toSteMessageHeader(string serializedXml, bool remote = false) {
        	int from = serializedXml.IndexOf("<CONTENT>") + "<CONTENT>".Length;
        	int to   = serializedXml.LastIndexOf("</CONTENT>");
        	
        	string header = "";
        	
        	if (!remote)
        	{
        	    header = "PASSTHRU,MMOVINF,";
        	}
        	else
        	{
        	    header = "RanorexAgent:PASSTHRU,MMOVINF,";
        	}
        	string result = header + serializedXml.Substring(from, to-from);
        	
        	return result;
        }
        
        
       
        public static MIS_MovementInformationConfig validateMovementInformationMessagePerf( string opstaLocation, string additionalFilters, string locationType="O",  int timeInSeconds=5,bool retry=true)
        {
            MsgFilter msgFilters = new MsgFilter();
            
            if (opstaLocation.Contains("|"))
            {
	            string[] stationList = opstaLocation.Split('|');
	            for (int i = 0; i < stationList.Length; i++)
	                {
	            	msgFilters.AddFilter(stationList[i],"DATA_LOCATION");
	            }
            } else 
            {
            	msgFilters.AddFilter(opstaLocation,"DATA_LOCATION");
            }

            if(additionalFilters != "")
            {
                if(additionalFilters.Contains("|"))
                {
                    string[] filterArr = additionalFilters.Split('|');

                    foreach(string filter in filterArr)
                    {
                        msgFilters.AddFilter(filter);
                    }
                }
                else
                {
                    msgFilters.AddFilter(additionalFilters);
                }
            }
            string filters = msgFilters.FormatFilters();
            
            

            STE.Code_Utils.ReceiveMISFileCollection_CN.clearFilters();
            STE.Code_Utils.ReceiveMISFileCollection_CN.addValueToFilters(filters);
            MIS_MovementInformationConfig mis_movementMessage = STE.Code_Utils.ReceiveMISFileCollection_CN.validateMovementInformationMessagePerf(timeInSeconds, retry);
            
            
            STE.Code_Utils.ReceiveMISFileCollection_CN.clearFilters();
            return mis_movementMessage;
        }
        
        
       
        
